import React from 'react';
import styled from 'styled-components';

const FooterSection = styled.footer`
  background-color: #333;
  color: #fff;
  text-align: center;
  padding: 1rem;
  position: fixed;
  width: 100%;
  bottom: 0;
`;

const Footer = () => {
  return (
    <FooterSection>
      <p>&copy; {new Date().getFullYear()} Your Name. All rights reserved.</p>
    </FooterSection>
  );
};

export default Footer;
